import React, {useEffect,useState} from 'react';
import About from "../components/about.js"
import ProjectLink from "../components/project_link.js"

function Home() {
  //----------------------Getting the data from my backend
  axios.get('https://tranquil-brushlands-15503.herokuapp.com/')
  .then(function (response) {
    console.log(response);
  })
  .catch(function (error) {
    console.log(error);
  });


  return (
    <div className="home">
      <About/>
      <section className = "projects_home">
        <ProjectLink projectName = {projectName} projectImage = {projectImage} projectDescription = {projectDescription}/>
        <ProjectLink/>
        <ProjectLink/>
        <ProjectLink/>
        <ProjectLink/>
        <ProjectLink/>
        <ProjectLink/>
      </section>      
    </div>
  );
}

export default Home;
